import { Link } from "react-router-dom";

const GameInlist = (props) => {

    return (
        <Link to={"http://localhost:8080/videogame/" + props.children.videogameId}>
            <div className="imgContainer">
                <img src={"data:image/png;base64," + props.children.cover}/>
            </div>
        </Link>

    )

}

export default GameInlist;
